        </div>

        {/* Router */}
        <div className="content">
          <Route exact path="/donate/1">
            content1
          </Route>
          <Route exact path="/donate/2">
            content2
          </Route>
        </div>
      </div>
    </Router>
  );
};

export default Donate;
